import { Chart } from "react-google-charts";
import _ from "loadsh";
export default function fundo({ children: fundo = null }) {
  console.log(fundo.relatorio);
  const rel = fundo.relatorio;
  const values = _.groupBy(rel, (value) => value.investmentId);
  console.log("values", values);

  const data = [
    ["Year", "Sales", "Expenses", "Profit"],
    ["2014", 1000, 400, 200],
    ["2015", 1170, 460, 250],
    ["2016", 660, 1120, 300],
    ["2017", 1030, 540, 350],
  ];
  const options = {
    chart: {
      title: "Company Performance",
      subtitle: "Sales, Expenses, and Profit: 2014-2017",
    },
  };
  if (!fundo) {
    return <div>Sem Fundos</div>;
  }
  return (
    <div fundoid={fundo.id} className="border p-1 border-gray-light m-2">
      {fundo.description}
      <Chart
        chartType="Bar"
        width="100%"
        height="400px"
        data={data}
        options={options}
      />
    </div>
  );
}
